    <path fill="#fcd116" d="M0 0h450v200H0z" />
    <path fill="#ce1126" d="M0 0h450v100H0z" />
    <path d="M225 100l32.492 100-85.065-61.803h105.146L192.508 200z" />
  </svg>
);

export default FlagGh;
